This book is in greek language, so the comments are in same language too.


O Stylianos Pattakos me to biblio tou auto kanei mia proseggish sth lailapa tou kommounismou e3aitias tou opoiou tosa ypefere h Ellada apo to 1941 mexri to 1949, opote kai oi dhmokratikes dunameis tou Stratou kai ths Xwrofylakhs eswsan thn Ellada apo to Sidhroun Parapetasma.


Writer: Stulianos Pattakos
Publisher: EKDOSIS
Publication Year: 2006
Edition: 2nd
Pages: 150
Language: Greek
ISBN: 960-88538-1-8

Skanarismeno se eikones JPEG sta 300dpi.
Oi eikones exoun onoma ton ari8mo selidas kai kefalaiou pou antiproswpeuoun.

